import React, { useEffect, useState } from "react";
import axios from "axios";
function PersonList() {
  const [persons, setpersons] = useState([]);
  useEffect(() => {
    axios
      .get("http://127.0.0.1:8000/api/person/")
      .then((res) => {
        setpersons(res.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);
  return (
    <div>
      <ul>
        {persons.map((item) => (
          <li key={item.id}>
            My name is : {item.name} and my lastname is {item.lastname}. I am{" "}
            {item.age} years old
          </li>
        ))}
      </ul>
    </div>
  );
}

export default PersonList;
